import blogs from "./Blogs";
function Blog(props) {
  return (
    <div className="blogBoxes">
      <div className="box">
        <img src={props.image} height="300px" width="290px" />
        <h6 className="blog-dates">{props.date}</h6>
        <h4 className="blog-headings">{props.bHeading}</h4>
        <button className="blog-btn">Read more</button>
      </div>
    </div>
  );
}
function App() {
  return (
    <div className="blogBoxes">
      <Blog
        img={blogs[0].image}
        date={blogs[0].date}
        bHeading={blogs[0].bHeading}
      />
      <Blog
        img={blogs[1].image}
        date={blogs[1].date}
        bHeading={blogs[1].bHeading}
      />
      <Blog
        img={blogs[2].image}
        date={blogs[2].date}
        bHeading={blogs[2].bHeading}
      />
    </div>
  );
}

export default App;
